import React from "react";
import {BrowserRouter as Router, Route , Routes } from "react-router-dom";
//import { Redirect,  Switch } from "react-router";
//import Switch from "react-js-switch";
import {ToastContainer} from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

import "./App.css";
//import configuracion from "./Paginas/configuracion.js";
//import editor from "./Paginas/editor.js";
//import inicio from "./Paginas/inicio";
//import vista from "./Paginas/vista.js";

function App() {
  return (
    <Router>
      <div className="App">
        <ToastContainer/>
        <Routes>
          <Route path="/" element ={<inicio/>}> </Route>
          <Route path="/add" component ={<editor/>}/>
          <Route path="/update/:id" component ={<editor/>}/>
          <Route path="/view/:id" component ={<vista/>}/>
          <Route path="/about" component ={<configuracion/>}/>


        </Routes>
      </div>
    </Router>

  );
}

export default App;
